INSERT INTO `posts` VALUES (2,'მოსაზრებები საარჩევნო კოდექსში შესატანი ცვლილებების პირველად პროექტთან დაკავშირებით ','„საქართველოს ახალგაზრდა იურისტთა ასოციაცია“, „საერთაშორისო გამჭირვალობა – საქართველო“, „სამართლიანი არჩევნებისა და დემოკრატიის საერთაშორისო საზოგადოება“ და „ახალი თაობა - ახალი ინიციატივა’’ აქტიურად ვაკვირდებოდით საარჩევნო გარემოს გაუმჯობესების მიზნით მიმდინარე მოლაპარაკებების პროცესს. 30 ივნისს ორგანიზაციებმა გამოვხატეთ მკვეთრი პოზიცია რვა პარტიის მიერ შეთანხმებულ საკითხებთან დაკავშირებით, შევაფასეთ რა ისინი როგორც არასაკმარისი საარჩევნო გარემოს რეალური გაჯანსაღებისათვის ქვეყანაში. ','2011-09-16 12:22:23',NULL,NULL,1,'text'),(9,'Meteorite in SW, US','Meteorite in SW, United States.\nWednesday, 14 September 2011.','2011-09-18 16:26:39',NULL,'<iframe width=\"250\" height=\"160\" src=\"http://www.youtube.com/embed/2MFvq4kJfmo\" frameborder=\"0\" allowfullscreen></iframe>',1,'video'),(10,'Testing document uploading','Tbilisi bus rutes in CSV/Excel format.','2011-09-18 16:31:33','uploads/documents/600transportation.zip',NULL,1,'document'),(11,'Testing links in the post and comments','www.jumpstart.ge ashd kslh djkl hjklsah djklhkajs','2011-09-19 11:31:51',NULL,NULL,1,'text'),(12,'MapSpot by Users\' Browsers','','2011-09-19 12:09:23','uploads/images/a5fa0_browsers.png',NULL,1,'photo'),(13,'Hello world!','Welcome to GYLA\'s own Facebook application!','2011-09-19 13:17:54',NULL,NULL,1,'text'),(14,'Video','This is important!','2011-09-19 13:20:32',NULL,'<iframe width=\"250\" height=\"160\" src=\"http://www.youtube.com/embed/TDuP8PtDJbE\" frameborder=\"0\" allowfullscreen></iframe>',1,'video');
